import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import { Container } from "react-bootstrap";
import { Link } from "react-router-dom";
import axios from "axios";

import { NavBar } from "../../components/sections/navBar";
import { Footer } from "../../components/sections/footer";

// import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
// import { solid, regular, brands, icon } from '@fortawesome/fontawesome-svg-core/import.macro'

export function NearByRequests() {
  const [requests, setRequests] = useState([]);

  useEffect(function () {
    getRequestsList();
  }, []);

  async function getRequestsList() {
    try {
      const response = await axios.get("http://localhost:5000/getOtherPeopleRequests");
      
      if(response.data.statusCode === '0') {
        setRequests(response.data.reqResults);
      } else {
        console.log("Some thing went wrong.....Required error handling...");
        
      }
    } catch (error) {
      console.log("error", error);
    }
  }

  

  return (
    <div>
      <NavBar />
      <Container>
        <div>
          <h1>Near By Requests</h1>
        </div>
      </Container>
      <Footer />
    </div>
  );
}
